import React from "react";
import './index.css'
import {connect} from 'react-redux'
import {orderName} from '../../actions'
import { Link } from "react-router-dom";

export  function Filtro (props){
    function OrderName (){
        props.Name();
    }
    return (
        <div className="filtro">
            <Link to= {'/home'}>
             <div className="orden">
                <h4>ordenar</h4>
                <button id='peso'>peso</button>
                <button id='nombre' onClick={OrderName}>nombre</button>
            </div>
            </Link>
            <div className="filtra">
                <h4>filtrar</h4>
                <div>
                    <h5>Temperamento</h5>
                    <nav>
                        <ul id="menutemp">
                        </ul>
                    </nav>
                </div>
                <div>
                    <h5>Raza</h5>
                    <nav>
                        <ul id="menuraza">
                        </ul>
                    </nav>
                </div>
            </div>     
        </div>
    )
}

const mapStateToProps = state => {
    return {
        Perritos: state.listaPerritos,
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        Name: () => dispatch(orderName())
    }
}

export default connect (mapStateToProps,mapDispatchToProps)(Filtro)
